import React from 'react';
import {BrowserRouter,Routes ,Route} from 'react-router-dom';
import Sapling from './components/sapling';

const App=()=>{
    return (
        <div>
            <p>bvbuj</p>
        <BrowserRouter>
        {/* <Routes> */}
            <Route  component={Sapling} path="/"/>
            {/* </Routes> */}
        </BrowserRouter>
        </div>

    )
};
export default App;
